CREATE TABLE "products" ("id" integer primary key autoincrement not null, "name" varchar not null, "price" numeric not null, "stock" integer not null, "brand_id" integer not null, "category_id" integer not null, "type_id" integer not null, "vehicle_id" integer not null, "created_at" datetime, "updated_at" datetime, foreign key("brand_id") references "brands"("id"), foreign key("category_id") references "categories"("id"), foreign key("type_id") references "types"("id"), foreign key("vehicle_id") references "vehicles"("id"));

